import React from 'react'
import MovieRow from '../../../components/MovieRow'

export default function Latest({openMoreInfo, featureData, windowWidth, latestList}) {
  return (
    <>

      <section className="lists">
        {latestList.map((item, key) => (
          <MovieRow
            key={key}
            title={item.title}
            items={item.items}
            onClickItem={openMoreInfo}
          />
        ))}
      </section>
    </>
  )
}
